265	Porkkala, 1944-56	http://kokoelmat.fng.fi/app?action=image&profile=CC0&iid=N0228500	106	From 1944–1954, Porkkala was leased to the Soviet Union as a military base and no Finns were allowed into the area. In 1980, artist Jan Kaila moved to the region and was inspired by his new hometown's history:\n\n"If you look carefully, you can still see Cyrillic letters forming the name K O L J A carved into the trunk of a birch tree in the small village of Torsvik twenty miles from Helsinki. Who was Kolja, and when and why did he leave his signature behind him?"\n\nKaila began to make an inventory of writings, photographs and objects left behind by the tens of thousands of Red Army soldiers and their families. The marks of this closed era were still to be found in homes and gardens. His research led to a work combing photographs and text – and a finely-tuned memorial to Porkkala's past. 	2018-10-11 12:52:12.457391	2018-10-11 12:52:12.457391	1991	Kiasma, Finnish National Gallery
